async () => {
  // Step 1: Fill field #name with "John Doe"
  await context.page.fill('#name', 'John Doe');

  // Step 2: Fill field #email with "john@example.com"
  await context.page.fill('#email', 'john@example.com');

  // Step 3: Fill field #message with "Hello, this is a test message"
  await context.page.fill('#message', 'Hello, this is a test message');

  // Step 4: Click the submit button
  await context.page.click('button[type="submit"]');

  // Step 5: Wait for #result to appear
  await context.page.waitForSelector('#result');

  // Step 6: Get the text content from #result
  vars.resultText = await context.page.textContent('#result');

  return { success: true };
}

async () => {
  return {
    resultText: vars.resultText,
    formFilled: true
  };
}

